import React, { useState } from 'react';
import { data } from "./data/db.json";


function Tours() {
    const [tours, setTours] = useState(data);

    return (
      <div>
        {tours.map((tour) => (
          <div key={tour.id}>
            <h2>{tour.name}</h2>
            <img src={tour.image} alt={tour.name} />
          </div>
        ))}
      </div>
    );
  }
  export default Tours;
